import React from 'react';
import styled from 'styled-components';

const HeroContainer = styled.section`
  min-height: 100vh;
  display: flex;
  align-items: center;
  justify-content: center;
  padding: 2rem;
  background: #1a1a2e;
  color: white;
`;

const HeroContent = styled.div`
  text-align: center;
  max-width: 800px;
`;

const Title = styled.h1`
  font-size: 3rem;
  margin-bottom: 1rem;
  color: #40e0ff;
`;

const Subtitle = styled.h2`
  font-size: 1.5rem;
  margin-bottom: 2rem;
  color: #ffffff;
`;

const Description = styled.p`
  font-size: 1.1rem;
  line-height: 1.6;
  color: #cccccc;
`;

const HeroTest: React.FC = () => {
  return (
    <HeroContainer id="home">
      <HeroContent>
        <Title>Hi, I'm Ollie</Title>
        <Subtitle>Data Analyst | BI Developer | Process Optimisation Expert</Subtitle>
        <Description>
          Passionate data analyst with expertise in transforming complex data into actionable insights. 
          Specializing in business intelligence, machine learning, and data visualization to drive strategic decision-making.
        </Description>
      </HeroContent>
    </HeroContainer>
  );
};

export default HeroTest;
